import logo from "./logo.svg";
import logoJpg from "./logo.jpg";
import "./App.css";

const linksList = [
  { text: "Home", url: "#" },
  { text: "About", url: "#" },
  {
    text: "Tours",
    url: "#",
  },
  {
    text: "Services",
    url: "#",
  },
  {
    text: "Contact",
    url: "#",
  },
];

export default function App() {
  return (
    <div className="App">
      <Header />
    </div>
  );
}

function Header() {
  return (
    <header className="header">
      <div>
        <img className="logo" src={logoJpg} alt="Logo" />
      </div>

      <div className="main-menu">
        <ul className="links-list">
          <a>Home</a>
        </ul>
      </div>
    </header>
  );
}
